package com.jzdata.aimedical.secret.consts;import lombok.AllArgsConstructor;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.ToString;/** * 拦截标识枚举 * * @author caoqiang * @date 2020/1/14 0014上午 11:58 */@Getter@ToString@NoArgsConstructor@AllArgsConstructorpublic enum DefaultFilterType {  /**   * 不拦截，可以被匿名访问   */  anon("anon"),  /**   * 必须认证(即登录)后才可能访问的页面   */  authc("authc"),  /**   * 资源权限认证   */  perms("perms"),  /**   * 角色权限认证   */  roles("roles"),  authcBasic("authcBasic"),  logout("logout"),  noSessionCreation("noSessionCreation"),  port("port"),  rest("rest"),  ssl("ssl"),  user("user");  private String value;}